pub enum Connection<A, B = Box<dyn ConnectionIo>> where A: ConnectionIo,
         B: ConnectionIo {
    Tcp(ConnectionType<A>),
    Tls(ConnectionType<B>),
}

pub enum ConnectionType<Io: ConnectionIo> {
    H1(H1Connection<Io>),
    H2(H2Connection<Io>),
}

pub enum InvalidUrl {
    MissingScheme,
    UnknownScheme,
    MissingHost,
    HttpError(http::Error),
}

pub enum FreezeRequestError {
    Url(InvalidUrl),
    Http(HttpError),
    Custom(Box<dyn StdError>, Box<dyn fmt::Debug>),
}

pub enum EncoderError<E> {
    Body(E),
    Boxed(Box<dyn StdError>),
    Blocking(BlockingError),
    Io(io::Error),
}

pub enum RequestHeadType {
    Owned(RequestHead),
    Rc(Rc<RequestHead>, Option<HeaderMap>),
}

pub enum Payload<S = PayloadStream> {
    None,
    H1(crate::h1::Payload),
    H2(crate::h2::Payload),
    Stream(S),
}

pub enum Item {
    FirstText(Bytes),
    FirstBinary(Bytes),
    Continue(Bytes),
    Last(Bytes),
}

pub enum DispatcherError<E, U, I> where U: Encoder<I> + Decoder {
    Service(E),
    Encoder(<U as Encoder<I>>::Error),
    Decoder(<U as Decoder>::Error),
}
